  <script src="/cypher/maze/three.min.js"></script>
  <script type="x-shader/x-vertex" id="vertex-shader">
    varying vec2 vuv;
    attribute float lightness;
    varying float _lightness;

    void main() {
        _lightness = lightness;
        vuv = uv;
        gl_Position = projectionMatrix * modelViewMatrix * vec4(position, 1.0);
    }
</script>

  <script type="x-shader/x-fragment" id="fragment-shader">
  uniform sampler2D texture1;
  uniform sampler2D texture2;
  uniform float texscale;

  varying vec2 vuv;
  varying vec4 vl;

  void main() {
      gl_FragColor = texture2D(texture1, vuv * texscale);
  }
</script>

  <script type="x-shader/x-fragment" id="fragment-shader-light">
  void main() {
      gl_FragColor = vec4(1.0, 1.0, 1.0, 1.0);
  }
</script>

  <script type="x-shader/x-fragment" id="fragment-shader-lightmap">
  uniform sampler2D texture1;
  uniform float texscale;
  varying float _lightness;

  varying vec2 vuv;

  void main() {
      gl_FragColor = texture2D(texture1, vuv * texscale);
      gl_FragColor.rgb *= _lightness;
  }
</script>

  <script type="x-shader/x-fragment" id="fragment-shader-lightmap-no-tex">
  varying float _lightness;

  void main() {
      gl_FragColor = vec4(vec3(_lightness), 1.0);
      gl_FragColor.rgb *= _lightness;
  }
</script>

  <script type="x-shader/x-fragment" id="fragment-shader-black">
  uniform sampler2D texture1;
  uniform sampler2D texture2;
  uniform float texscale;

  varying vec2 vuv;

  void main() {
      gl_FragColor = vec4(0.0, 0.0, 0.0, 1.0);
  }
</script>
